import React from 'react';
import { View, Text, StyleSheet } from 'react-native';
import globalStyles from './../../../styles/globalStyles.js';
import DrawerHeader from './DrawerHeader.js';

const Generations = (props) => {
    return (
        <View>
            <Text style={styles.drawerTitle}>Generations</Text>
            <Text style={styles.drawerDesc}>Use search for generations to explore your Pok√©mon!</Text>

        </View>
    )
}

export default Generations;

const styles = StyleSheet.create({
    drawerTitle: {
        fontSize: 26,
        color: globalStyles.textblack
    },

    drawerDesc: {
        fontSize: 16,
        color: globalStyles.textgrey
    }
})
